        <p>Privacy Policy</p>
        <p>Terms of Service</p>
        <p>Made By <a href="https://example.com/venkykumar" class="custom-link"><span class="bold-text">Venky Kumar</span></a></p>

    </div>
</div>
  )
}

export default Footer
